body {
  font-family: Garamond, Arial, "Helvetica Neue", sans-serif;
}

.container {
  align-items: center;
  display: flex;
  flex-direction: column;
  height: 100%;
  height: 100vh;
  justify-content: center;
  text-align: center;
}

.subtext-container {
  display: flex;
  flex-direction: row;
}

.first-subtext{
  display: inline-block;
}

.second-subtext{
  display: inline-block;

}

.header {
  display: inline-block;
  font-size: 2em;
  margin-bottom: 5px;
}

.sub-text {
  color: rgb(126, 126, 126);
  font-size: 1.5em;
  line-height: 1.4em;
}

.links {
  display: flex;
  height: auto;
  margin-top: 20px;
  max-height: 100px;
  overflow: hidden;
  transition: max-height 1s ease-out;
}

#links {
  position: fixed;
  top: 0px;
  right: 30px;
  width: auto;
}

.links.collapsed {
  max-height: 0;
}

.links .link {
  background-color: #fdfdfd;
  border-radius: 90%;
  cursor: pointer;
  margin: 10px 10px;
  padding: 11px;
}

.links .link:hover {
  background-color: #eee;
}

.links .link p {
  font-size: 0.8em;
  margin-bottom: 0;
}

.fill-black {
  fill: #000;
}
